ur theme has multiple menus, giving them clear names will help you manage them.'=>'Hat dein Theme mehrere Menüs, dann kann es hilfreich sein, wenn du ihnen eindeutige Namen gibst.','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Falls dein Theme Widget-Bereiche hat, kannst du dort auch Menüs hinzufügen. Gehe zum <a href="%s">Widget-Bereich</a> und füge ein &#8222;Navigations-Menü&#8220;-Widget hinzu, um ein Menü in einer Seitenleiste oder im Footer anzuzeigen.','New Menu'=>'Neues Menü','Create New Menu'=>'Neues Menü erstellen','Name for the Visual editor tabVisual'=>'Visuell','Usage of user levels is deprecated. Use capabilities instead.'=>'Die Verwendung von Benutzer-Levels ist veraltet. Verwende stattdessen Berechtigungen.','Date'=>'Datum','Month'=>'Monat','Day'=>'Tag','Time'=>'Zeit','Hour'=>'Stunde','Minute'=>'Minute','Meridian'=>'Längengrad','%1$s-%2$s'=>'%1$s-%2$s','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klicke &#8222;Neues Bild hinzufügen&#8220;, um ein Bild von deinem Computer hochzuladen. Das Theme wirkt am besten, wenn das Bild der Größe deines Videos entspricht. Du kannst dein Bild nach dem Hochladen zuschneiden, um es optimal anzupassen.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klicke &#8222;Neues Bild hinzufügen&#8220;, um ein Bild von deinem Computer hochzuladen. Das Theme wirkt am besten mit einem Header-Bild, das eine Größe von %s Pixel hat. Du kannst dein Bild nach dem Hochladen zuschneiden, um es optimal anzupassen