 zur Darstellung deiner Teammitglieder.','Block pattern categoryTestimonials'=>'Testimonials','Share reviews and feedback about your brand/business.'=>'Teile Rezensionen und Feedback über deine Marke/dein Unternehmen.','Block pattern categoryServices'=>'Dienste','Briefly describe what your business does and how you can help.'=>'Beschreibe kurz, was dein Unternehmen macht und wie du helfen kannst.','Block pattern categoryContact'=>'Kontakt','Display your contact information.'=>'Zeige deine Kontaktinformationen an.','Introduce yourself.'=>'Stell dich vor.','Block pattern categoryPortfolio'=>'Portfolio','Showcase your latest work.'=>'Präsentiere deine neuesten Arbeiten.','Different layouts for displaying images.'=>'Verschiedene Layouts für die Anzeige von Bildern.','Different layouts containing video or audio.'=>'Verschiedene Layouts mit Video oder Audio.','A variety of footer designs displaying information and site navigation.'=>'Eine Vielzahl an Designs für Footer für die Anzeige von Informationen und Website-Navigation.','A variety of header designs displaying your site title and navigation.'=>'Eine Vielzahl an Designs für Header, die den Titel und die Navigation deiner Website anzeigen.','Untitled post %d'=>'Unbenannter Beitrag %d','untitled post %s'=>'Beitrag %s ohne Titel',': %s'=>': %s','There&#8217;s no content to show here yet.'=>'Es gibt hier noch keinen Inhalt, der angezeigt werden kann.','The image already has the requested size.'=>'Das Bild hat bereits die gewünschte Größe.','Values for the input array must be either objects or arrays.'=>'Die Werte für das Eingabe-Array müssen entweder Objekte oder Arrays sein.','Arguments cannot be prepared as both an Identifier and Value. Found the following conflicts: %s'=>'Argumente können nicht sowohl als Bezeichner als auch als Wert bereitgestellt werden. Es wurden folgende Konflikte gefunden: %s','Sorry, replies to unapproved comments are not allowed.'=>'Antworten auf nicht freigegebene Kommentare sind leider nicht erlaubt.','https://wordpress.org/documentation/article/manage-wordpress-widgets/'=>'https://wordpress.org/documentation/article/manage-wordpress-widgets/','Warning: %1$s expects parameter %2$s (%3$s) to be a %4$s, %5$s given.'=>'Warnung: %1$s erwartet, dass der Parameter %2$s (%3$s) vom Typ %4$s ist, %5$s gegeben.','Too many bookmarks: cannot create any more.'=>'Zu viele Lesezeichen: Es können keine weiteren erstellt werden.','Unknown bookmark name.'=>'Unbekannter Name des Lesezeichens.','Too many calls to seek() - this can lead to performance issues.'=>'Zu viele Aufrufe von seek() – dies kann zu Leistungsproblemen führen.','Invalid attribute name.'=>'Der Attributname ist ungültig.','The query argument must be an array or a tag name.'=>'Das Abfrageargument muss ein Array oder ein Schlagwort-Name sein.','When using the %1$s constant, make sure to set these globals to an array: %2$s.'=>'Wenn du die Konstante %1$s benutzt, stelle sicher, dass du diese globalen zum Array hinzufügst: %2$s.','Please check that the %s PHP extension is installed and enabled.'=>'Bitte überprüfe, ob die PHP-Erweiterung %s installiert und aktiviert ist.','Block pattern categoryBanners'=>'Banner','Block pattern categoryPosts'=>'Beiträge','Block pattern categoryTeam'=>'Team','Block pattern categoryAbout'=>'Über','Used as a fallback template for all pages when a more specific template is not defined.'=>'Wird als Fallback-Template für alle Seiten benutzt, wenn kein spezifischeres Template definiert ist.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'Zeigt die letzten Beiträge entweder als Homepage der Website oder als „Beitragsseite“ an, wie unter den Einstellungen „Lesen“ definiert. Wenn es existiert und wenn Beiträge auf der Homepage angezeigt werden, überschreibt das Startseiten-Template dieses Template.','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Zeigt die Homepage deiner Website an, egal ob eingestellt ist, dass sie die letzten Beiträge oder eine statische Seite anzeigt. Das Startseiten-Template erhält Vorrang vor allen anderen Templates.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'Zeigt jeden einzelnen Eintrag wie einen Beitrag oder eine Seite an. Dieses Template wird als Fallback ausgeliefert, wenn kein spezifischeres Template (z. B. Einzelbeitrag, einzelne Seite oder einzelner Anhang) gefunden werden kann.','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'Zeigt einen einzelnen Beitrag auf deiner Website an, solange kein individuelles Template für diesen Beitrag angewendet wird oder ein zugehöriges Template existiert.','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'Zeigt eine statische Seite an, solange kein individuelles Template auf diese Seite angewendet wird oder ein zugehöriges Template existiert.','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'Zeigt jedes Archiv an, inklusive Beiträge eines einzelnen Autors, einer Kategorie, eines Schlagworts, einer Taxonomie, eines individuellen Inhaltstyps und eines Datums. Dieses Template wird als Fallback ausgeliefert, wenn kein spezifischeres Template (z. B. Kategorie oder Schlagwort) gefunden werden kann.','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'Zeigt ein Archiv für Beiträge eines einzelnen Autors an. Dieses Template wird als Fallback ausgeliefert, wenn kein spezifischeres Template (z. B. Autor: Admin) gefunden werden kann.','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'Zeigt ein Archiv für eine Beitragskategorie an. Dieses Template wird als Fallback ausgeliefert, wenn kein spezifischeres Template (z. B. Kategorie: Rezepte) gefunden werden kann.','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'Zeigt ein Archiv für eine individuelle Taxonomie an. Wie Kategorien und Schlagwörter haben Taxonomien Begriffe, die du benutzt, um Dinge zu klassifizieren. Zum Beispiel: Eine Taxonomie namens „Kunst“ kann mehrere Begriffe beinhalten, wie „Modern“ und „18. Jahrhundert“. Dieses Template wird als Fallback ausgeliefert, wenn kein spezifischeres Template (z. B. Taxonomie: Kunst) gefunden werden kann.','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'Zeigt ein Beitragsarchiv an, wenn ein spezifisches Datum angegeben ist (z. B. example.com/2023/).','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g. Tag: Pizza) cannot be found.'=>'Zeigt ein Archiv für Beitragsschlagwörter an. Dieses Template dient als Fallback, wenn kein spezifischeres Template (z. B. Schlagwort: Pizza) gefunden werden kann.','Displays when a visitor views the dedicated page that exists for any media attachment.'=>'Wird angezeigt, wenn ein Besucher die zugehörige Seite anzeigt, die für jeden Medienanhang existiert.','Displays when a visitor performs a search on your website.'=>'Wird angezeigt, wenn ein Besucher auf deiner Website eine Suche durchführt.','Displays your site\'s Privacy Policy page.'=>'Zeigt die Datenschutzerklärungs-Seite deiner Website an.','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'Wird angezeigt, wenn ein Besucher eine nicht vorhandene Seite anzeigt, wie etwa einen toten Link oder eine falsch getippte URL.','Get Involved'=>'Mitmachen','custom backgroundBackground'=>'Hintergrund','custom image headerHeader'=>'Header','block categoryPatterns'=>'Vorlagen','template part areaGeneral'=>'Allgemein','template part areaHeader'=>'Header','template part areaFooter'=>'Footer','Template nameBlog Home'=>'Blog-Startseite','Template nameSingle Entries'=>'Einzeleinträge','Template nameAll Archives'=>'Alle Archive','Template nameAuthor Archives'=>'Autoren-Archive','Template nameCategory Archives'=>'Kategorie-Archive','Template nameDate Archives'=>'Datums-Archive','Template nameTag Archives'=>'Schlagwort-Archive','Attachment Pages'=>'Anhang-Seiten','Template nameSearch Results'=>'Suchergebnisse','Template namePage: 404'=>'Seite: 404','Expand search field'=>'Das Suchfeld erweitern','The menu provided is not a valid menu.'=>'Das angegebene Menü ist kein gültiges Menü.','The duotone id "%1$s" is not registered in %2$s settings'=>'Die Duoton-ID „%1$s“ ist nicht in den %2$s-Einstellungen registriert','No Classic Menus found.'=>'Es wurden keine klassischen Menüs gefunden.','Unable to convert Classic Menu to blocks.'=>'Das klassische Menü kann nicht in Blöcke umgewandelt werden.','Title of a Navigation menuNavigation'=>'Navigation','Post trashed.'=>'Der Beitrag wurde in den Papierkorb verschoben.','Page trashed.'=>'Die Seite wurde in den Papierkorb verschoben.','Invalid strategy `%1$s` defined for `%2$s` during script registration.'=>'Ungültige Strategie `%1$s` für `%2$s` während der Skript-Registrierung definiert.','Cannot supply a strategy `%1$s` for script `%2$s` because it is an alias (it lacks a `sr